package main

import (
	"bytes"
	"encoding/base64"
	"github.com/themakers/gocv_utils/imgop"
	"gocv.io/x/gocv"
)

var demoImage = (func() gocv.Mat {
	imgData, err := base64.StdEncoding.DecodeString(imageBase64)
	if err != nil {
		panic(err)
	}

	return imgop.LoadBytes(bytes.NewReader(imgData))
})()

